{"time": "05:55 01/04/2020", "content": "THÔNG BÁO VỀ 5 CA BỆNH 209 - 212: Bệnh nhân thứ 208 (BN208) là nữ nhân viên 38 tuổi của Công ty Trường Sinh cung cấp dịch vụ cho Bệnh viện Bạch Mai; BN209, nữ, 55 tuổi, ở Đức Giang, Long Biên, Hà Nội, nấu ăn cho Công ty Xăng dầu Khu vực I, từ 18/3 đến 24/3 có tiếp xúc gần với BN163. Những người có tiếp xúc gần với BN209 gồm: chồng, 2 con trai, mẹ đẻ và người giúp việc. BN210, nữ, 26 tuổi, ở huyện Can Lộc, tỉnh Hà Tĩnh, từ Thái Lan về ngày 20/3, trước đó có tiếp xúc gần với BN146; BN211, nữ, 23 tuổi, là du học sinh tại Mỹ, ở Chùa Láng, Láng Thượng, Đống Đa, Hà Nội. Ngày 19/3, bệnh nhân từ Mỹ về Việt Nam quá cảnh Abu Dhabi và Bangkok, đến Hà Nội ngày 20/3; BN212, nữ, 35 tuổi, ở Hòa Tiến, Hưng Hà, Thái Bình, cùng chồng từ Nga về Việt Nam ngày 27/3 trên chuyến bay mang số hiệu SU290 (ghế 42C).", "link": "https://ncov.moh.gov.vn/web/guest/dong-thoi-gian"}
